In sendEvent / subscribeToEvent it should be possible to pass complex data in the data packet.

It appears that sending basic data such as strings, ints, bools works, but sending arrays, object literals, and function callbacks doesn't pass through.

```
        eventTarget.sendEvent('complexData', {
            str: 'string',
            bool: true,
            arr: [1,2,3,4,5],
            obj: {
                name: 'obj'
            }
        });
```

I've put together a sample project that illustrates this at:
https://github.com/shaddockh/AtomicPlayground/tree/NEW-EDITOR/event_test
